-- Update some more values for about 330 quests.
UPDATE quests SET CompletionText = 'Well done, citizen.  Those kobolds are thieves and cowards, but in large numbers they pose a threat to us.  And the humans of Stormwind do not need another threat.$B$BFor defeating them, you have my gratitude.' WHERE entry = 7;
UPDATE quests SET CompletionText = '\'Twas a grim task, friend, but you held up your part of the bargain.$B$BI have some things here you might want - take your pick!', IncompleteText = 'Hey $N. How goes the hunt for diseased young wolves?' WHERE entry = 33;
UPDATE quests SET CompletionText = 'Ah! Wonderful. The wolf meat should do nicely. Oh, don\'t worry, $n, I wouldn\'t forget my part of the bargain. Here, one of these should fit you.' WHERE entry = 179;
UPDATE quests SET CompletionText = 'Argh! Those Light-blasted trolls!$b$b<He takes a few breaths and seems to settle down... a bit.>$b$bA group of them came in the night and stole my journal! I knew better than to trust that good-for-nothing appr...', IncompleteText = 'From what I\'ve learned, these trolls hail from the Frostmane clan. I\'m afraid I don\'t know much else about them that would be of any use to you, $n.' WHERE entry = 182;
UPDATE quests SET CompletionText = 'Excellent! I can go back to my... leisurely... hunting now. Thank you, $n.' WHERE entry = 183;
UPDATE quests SET CompletionText = 'Wonderful, $n! Many thanks for retrieving my notebook. Well, it would seem that the troll situation here in Coldridge Valley is under control and not much cause for worry.$b$bAfter I put the finishing touches on my report, I\'ll need someone to courier it to my brother Senir.', IncompleteText = '$n! Any luck?' WHERE entry = 218;
UPDATE quests SET IncompleteText = 'Hail! Have a care, $n, the tunnel to Dun Morogh is infested with troggs and is not safe for travel.$b$bIf you haven\'t any pressing business in Dun Morogh, I\'ll have to ask you to remain in Anvilmar until the tunnel is safer.' WHERE entry = 282;
UPDATE quests SET CompletionText = 'So these bandanas -- filthy tokens of corruption -- are what my Mac had to die for? Such a waste. Such a tragic sacrifice. $b$bBut alas, I cannot return to the past. Just know, $N, that you have brought my family justice through your deeds.' WHERE entry = 388;
UPDATE quests SET CompletionText = 'You fought like a true disciple of the Dark Lady, $n.  With the council dead, perhaps we can gain control of this town once and for all and drive Arugal from Shadowfang Keep.  I salute you!' WHERE entry = 452;
UPDATE quests SET IncompleteText = 'There is still work to be done, $N.  Return to me once you have thinned the nightsaber and thistle boar populations.' WHERE entry = 456;
UPDATE quests SET CompletionText = 'You have proven your dedication to nature well, $N.  A young $c like yourself has a promising future.', IncompleteText = 'Your task is not yet complete, $N.  Return to me once 5 mangy nightsabers and 5 thistle boars have been killed.' WHERE entry = 457;
UPDATE quests SET CompletionText = 'I see you found me, young $r.  Melithar is a wise druid to have sent you.' WHERE entry = 458;
UPDATE quests SET CompletionText = 'Your service to the creatures of Shadowglen is worthy of reward, $N.$b$bYou confirmed my fears, however.  If the grells have become tainted by the Fel Moss, one can only imagine what has become of the Gnarlpine tribe of furbolgs who once lived here.$b$bShould you find yourself in Dolanaar, able $C, seek out the knowledgeable druid, Athridas Bearmantle.  He shares our concern for the well being of the forest.', IncompleteText = 'Satisfy my suspicions, $N.  Bring to me 8 Fel Moss.' WHERE entry = 459;
UPDATE quests SET IncompleteText = 'Have you been a busy little bee, $N?  I\'ve been waiting for you to bring me what I need.' WHERE entry = 488;
UPDATE quests SET RequiredTradeskillValue = '1' WHERE entry = 715;
UPDATE quests SET CompletionText = 'The tauren of Narache thank you, $n. You show much promise.', IncompleteText = 'Providing meat and feathers for the tribe is the first step in proving yourself as a hunter before the Chief.' WHERE entry = 747;
UPDATE quests SET CompletionText = 'Hmmm, not bad, $n. But don\'t let it get to your head...you\'ll fight tougher than boars in your career.$b$bNonetheless, you\'ve proven yourself well, and your next trial will be against a considerably more dangerous opponent, so you\'ll need some extra protection.', IncompleteText = 'I hope you haven\'t returned to try and convince me that you have completed your task, $n? No, of course not. I would think better of you.' WHERE entry = 788;
UPDATE quests SET IncompleteText = 'The carapace of a scorpid isn\'t so thick that the strength of a determined warrior will be deterred. Strike strongly and without doubt, and the scorpids should prove easy prey.' WHERE entry = 789;
UPDATE quests SET CompletionText = 'Thank you, $N.  When I return to Darnassus I will compare the venom within these sacs with the venom of other spiders.  It is my belief that it will have properties linked to the recent growth of our new world tree.' WHERE entry = 916;
UPDATE quests SET IncompleteText = 'Have you been inside the Shadowthread Cave, $N?  Did you find a spider egg?' WHERE entry = 917;
UPDATE quests SET CompletionText = 'Shan\'do Stormrage never returned, and the druids were in disarray, and to this day we still do not know what became of him. With Malfurion missing, Arch Druid Fandral Staghelm took over the leadership of the druids, convincing the Circle of Ancients in Darkshore that it was time for our people to rebuild, and that it was time for our people to regain their immortality.$B$BWith the approval of the Circle, Staghelm and the most powerful druids grew Teldrassil, the new World Tree.' WHERE entry = 933;
UPDATE quests SET IncompleteText = 'Hmm... You come with the spirit of the forest strongly within you, $C. What business do you have with the Arch Druid of the Kaldorei?' WHERE entry = 940;
UPDATE quests SET CompletionText = 'Ah. Thank you, $N. It is strange, though. The Arch Druid always seems in such a hurry. The forest knows that all shall come to pass in the appointed time. Shan\'do Stormrage understood that.' WHERE entry = 952;
UPDATE quests SET CompletionText = 'Greetings, $c.$b$bI am pleased to see the likes of you taking an interest in the well being of nature; tales of your mighty deeds precede you, and you are welcomed here. Seeing you before me instills the feeling of confidence that the Cenarion Circle will get the proper aid it needs.$b$bOur connection with the Cenarion Circle in Moonglade transcends racial and political divides. Remember this as you work on behalf of the Circle, and you will do well.' WHERE entry = 1004;
UPDATE quests SET CompletionText = 'Greetings, $c.$b$bI am pleased to see the likes of you taking an interest in the well being of nature; tales of your mighty deeds precede you, and you are welcomed here. Seeing you before me instills the feeling of confidence that the Cenarion Circle will get the proper aid it needs.$b$bOur connection with the Cenarion Circle in Moonglade transcends racial and political divides. Remember this as you work on behalf of the Circle, and you will do well.' WHERE entry = 1018;
UPDATE quests SET CompletionText = 'What makes you think I wish to be pestered by the likes of you, $c? Wait - let me stop the important duties I attend to on a daily basis so I can help you locate a doodad somewhere. By all means, the welfare of Darnassus - nay, all of Teldrassil - should come second to the acquisition of a bauble for your collection.$b$bThe fools in Moonglade waste my time with their call for assistance, and now I must endure this?' WHERE entry = 1019;
UPDATE quests SET CompletionText = 'What makes you think I wish to be pestered by the likes of you, $c? Wait - let me stop the important duties I attend to on a daily basis so I can help you locate a doodad somewhere. By all means, the welfare of Darnassus - nay, all of Teldrassil - should come second to the acquisition of a bauble for your collection.$b$bThe fools in Moonglade waste my time with their call for assistance, and now I must endure this?' WHERE entry = 1047;
UPDATE quests SET RequiredQuest1 = '1083', RequiredQuest2 = '1084' WHERE entry = 1082;
UPDATE quests SET CompletionText = 'Let me be first to thank you for all you\'ve done, $n. You have been an incredible blessing to my people and the people of Stormwind. I am sorry I couldn\'t make your acquaintance under better circumstances.$b$bUnderstand also that I cannot overtly thank you for your efforts, but I assure you again, it is appreciated.$b$bWhen you visit Theramore in the future, seek me out and I shall try to keep you appraised of the situation.$b$bThank you again, $n.' WHERE entry = 1267;
UPDATE quests SET IncompleteText = 'That Infiltrator in Stonard will surely.... open up... after he drinks my special serum. Haha!$b$bThe ingredients required are by no means easy to procure. Shadow Panthers are common in the Swamp but collecting enough hearts for our purpose can be daunting. And the Mire Lord can be such a fussy beast.$b$b' WHERE entry = 1383;
UPDATE quests SET CompletionText = ' ' WHERE entry = 1462;
UPDATE quests SET CompletionText = 'So you\'re an engineer, eh? Well, for your help in getting me those pearls, here\'s the recipe for flash bombs.$b$bGood luck, and try not to blind yourself!' WHERE entry = 1559;
UPDATE quests SET CompletionText = 'Good day, $n. The Light is with you, I trust?$b$bWhat\'s that? You were sent by Duthorian!? My wife, how is she? I knew there was going to be trouble if I left. Please tell me she\'s... oh, thank goodness. I\'m so glad that she\'s safe. The Defias were a threat long before these attacks, but now the King\'s advisors cannot deny it.$b$bWhat else did Duthorian have to say?$b$bYou\'re the one that was sent to protect my wife? Then I thank you again, $n. I couldn\'t think of a better test of valor than that.' WHERE entry = 1653;
UPDATE quests SET CompletionText = 'Ah, the furs I was expecting. Thank you.$B$BThese came faster than I had expected. They will make good blankets for anyone who wishes to stay here.$B$BPlease feel free to stay as long as you like. My inn is always open and all of our people are welcome here. And don\'t underestimate a good night\'s rest, it can make a great difference while you\'re out traveling.', IncompleteText = 'Yes, young one? What can Kauth do for you?$B$BThe journey here from the Mesa can be a tremendous burden for some, but a welcome sight for others. Which is it for you, I wonder?' WHERE entry = 1656;
UPDATE quests SET CompletionText = 'I can barely believe it! Furen\'s technique was a success, and this armor should withstand tremendous levels of stress.$b$bHere you are, $n. And thank you. I wouldn\'t have believed Furen\'s discovery if you hadn\'t gathered the materials I needed to test it myself.' WHERE entry = 1706;
UPDATE quests SET CompletionText = 'Very good, I\'m glad Kaplak was able to get a hold of you.$b$bWe have some things to speak of, not the least of which is your future with the Hand.' WHERE entry = 1859;
UPDATE quests SET CompletionText = 'You have been sent to aid me in my task, $n?  Good.  It is heartening to see young mages eager to help in our cause...$b$bWhat cause, you ask?  In time, young one.  You shall know... in time.' WHERE entry = 1860;
UPDATE quests SET CompletionText = 'Oh, I can see you have promise, yes you do! But it takes more than promise to be a good $c.  And if you\'re not a good $c, then you\'re a bad $c.  And bad mages are part of the problem, yes they are!$b$bOops, I\'m getting ahead of things.  Let\'s begin at the start!' WHERE entry = 1879;
UPDATE quests SET CompletionText = 'Oh, splendid day!  When I made the gizmonitor I never realized how dependent on it I would become.  Now I can begin my studies anew!$b$bThank you, $n!  And here--these were my first tools as a $c.  They\'re a little scratched but they\'re well tested.  Take your pick--I\'m sure you\'ll find either of them useful.' WHERE entry = 1880;
UPDATE quests SET CompletionText = 'Greetings, $n.  You were wise to answer my call, and wiser still if you heed what I next say...' WHERE entry = 1881;
UPDATE quests SET CompletionText = 'Hail, $n.  Praise to you, for my call for aid is now answered.  Let us hope you are up to the task...' WHERE entry = 1883;
UPDATE quests SET CompletionText = 'Ah yes, the delivery of herbs from Shadowglen.  It is a shame Porthannius could not bring it himself, for we have much to discuss, he and I.  But I am glad to get the herbs nonetheless, and I am glad you came.$B$BWhile you are here, please, rest yourself.  Heroes must keep their strength and spirits high, and must find rest and solace whenever they may.  For to neglect one\'s peace of body and mind is a sure path to failure.$B$BSo... rest.', IncompleteText = 'How might I be of service to you, young one?  Are you here to rest in the inn?  Do you require a hearthstone?' WHERE entry = 2159;
UPDATE quests SET CompletionText = 'Ah, at last, the supplies from Hands! I was beginning to worry, we\'ve had scarce word from Anvilmar ever since the troggs overran the pass.$b$bThanks for bringing this to me, $n. And please, make yourself comfortable. You must be tired after your journey.' WHERE entry = 2160;
UPDATE quests SET CompletionText = 'Ah, this is the food Ukor brought to the Valley of Trials.  Did they not need it?  Well, I guess they like to starve you heroes in training.  Builds spirit, they say!$B$BThank you for returning the food.  I\'ll stick it back on the shelves... but here, let me offer you some refreshment first!$B$BAnd don\'t forget to rest here in the inn.  You may be a brave $c ready to take on the world, but if your energy is sapped you won\'t be doing yourself, or the Horde, much good.' WHERE entry = 2161;
UPDATE quests SET CompletionText = 'The wind approaches you quickly from the horizon; the earth is steady beneath your feet; and your spirit is already warmed by fire--I would say it is time for you to learn about the purity of water.$B$BYour path has led you this far, and your spirit will give you the strength to carry on even further. But the first step is yours to take. ' WHERE entry = 2986;
UPDATE quests SET CompletionText = 'Now we teach them those things, and they teach us others. We become one race... almost. We be allies for long time now. So you remember to help them. And Jen\'shan remember to help you.$B$BJen\'shan teach you da ways of the hunter--teach you good. You never forget, hunter\'s be respected greatly by da tribe. You be havin\' a large role to play in da future... you never forget that.$B$BWhen you feel da need, come to Jen\'shan. She teach you as much as she can when she feel you ready.' WHERE entry = 3082;
UPDATE quests SET CompletionText = 'And it is my job to make sure you are prepared by teaching you the basics of our profession--how to tame your pet, how to fire your rifle, and many other skills that will become necessary.$B$BHunters are a strong part of our tradition and history, $N. You would do well to remember how important you are to the tribe. You will be respected and revered if you serve our people well.', IncompleteText = 'Welcome to Camp Narache, $N. I hear good things about you. Your bloodline is strong, and many of the elders consider you skilled already. But that we will test.$B$BThe plains of Mulgore will be your home for sometime--you should do your best to learn it very well. One day you will travel to unfamiliar lands to master greater skills. You must be ready.' WHERE entry = 3092;
UPDATE quests SET CompletionText = 'In the meantime, you should know one or two other things. You are a symbol to many here in this land--act accordingly. The Holy Light shines within you, and it will be obvious to both your allies and your enemies.$B$BAlso, as you gain in wisdom and power, you will need to train to learn new abilities. That\'s where I come in. When you feel you\'ve gained some experience here in Northshire, come back to me and I will teach you what I feel you are ready to learn. Good luck... $c!', IncompleteText = 'Finally! We meet face to face, brother to $gbrother:sister;. I welcome you to Northshire. This will be your home for a short time while you learn the ins and outs of how things are done, but know that Stormwind is not far off, and sooner or later, your path will take you there. But until then, be patient... Knight of the Silver Hand.' WHERE entry = 3101;
UPDATE quests SET CompletionText = 'You\'re gonna find a number of outfits that covet our skills, $N. Adventurers, SI:7... heck, even the Defias Brotherhood wouldn\'t mind a spy or two inside Stormwind. But you remember this, you\'re your own $gman:woman;. Don\'t let nobody bully you into doing something you don\'t wanna do! Besides, we hold all the cards... at least, we do before the game\'s done. Know what I mean?$B$BAnyway, just wanted to introduce myself and let you know that I\'m here if you need any training. Come by anytime.', IncompleteText = 'You made it here in one piece, and it doesn\'t look like too many people saw you. Good enough for me. I don\'t like to have much attention drawn to me back here... nice and quiet. I\'m sure you can understand.$B$BHave any trouble yet? I\'m glad to hear not. That\'ll change soon enough.' WHERE entry = 3102;
UPDATE quests SET IncompleteText = 'You made it. I\'m so glad.$b$bMuch has happened over the last few years, $N: the creation of Teldrassil, the corruption of many of the forest creatures here and abroad, discovery of lands we thought lost to us like Feralas... so much, in so little time. But those are just some of the reasons we are here, the most important being to protect our kind from further evil.' WHERE entry = 3116;
UPDATE quests SET CompletionText = 'Until then, know that our kind are needed more than ever in this tenuous time. Peace with the other races can fail at any moment, and there is much talk about members of the Horde looking to sow even greater seeds of distrust. Remember that.$B$BAs you gain in power and feel more prepared, come back to me here and I will see about getting you some training. It\'s important that you know how to handle your weapon of choice, among other things.', IncompleteText = 'Hello, $N. I\'m glad you found me. I was thinking that perhaps you got lost on the way here.$B$BNothing really new has happened in Shadowglen since I sent you my sigil, but I\'ll leave all the information gathering to you. Speak to the rest of the people around Aldrassil if you\'d like.' WHERE entry = 3118;
UPDATE quests SET IncompleteText = 'Why hello there young $Gman:lady;. Would you like a tour of the museum?' WHERE entry = 3182;
UPDATE quests SET CompletionText = 'Huzzah, you\'ve found them!  You\'re an absolute savior, my friend.  Here, it\'s not much, but it\'s something for the trouble I\'ve put you through!  Thank you!', IncompleteText = 'Oh goodness $N, this town is not well suited for the likes of me.  There are as many nasty creatures here as there were in Gnomeregan before the accident!$B$BDo you have my belongings?  If you don\'t, then who knows what the trolls have done with them now...' WHERE entry = 3361;
UPDATE quests SET CompletionText = 'Ah good, now this will hit the spot.  Allow me to take a small break while I enjoy this scalding mornbrew!', IncompleteText = 'Aye, I\'m Durnan Furcutter.  You have something for me?' WHERE entry = 3364;
UPDATE quests SET CompletionText = 'Excellent, $N!  You\'d be surprised how many couriers I meet who forget to do something as simple as bring back the mug.  Mugs don\'t grow on trees, or so they tell me!$B$BHere\'s a little something for the effort.  Thanks again for your help.', IncompleteText = 'I trust the scalding mornbrew got to Durnan on time!  Did you remember to bring me back my mug?' WHERE entry = 3365;
UPDATE quests SET detailemote1 = '2', detailemote2 = '1', detailemote3 = '1' WHERE entry = 3765;
UPDATE quests SET CompletionText = 'Well done $N, I will be sure to give these to the Arch Druid himself when he has need of them. Meanwhile, please accept this as a token of the Cenarion Circle\'s appreciation.$b$bOur need for morrowgrain, for now, is constant; if you wish to continue aiding us, then please return when you have cultivated more of it.', IncompleteText = 'Yes $N, have you grown some morrowgrain for the Arch Druid\'s important research? The mysterious properties of Un\'Goro Crater become clearer with each passing day, thanks to the help you are giving us.' WHERE entry = 3785;
UPDATE quests SET detailemote1 = '1', detailemote2 = '1', detailemote3 = '1' WHERE entry = 3802;
UPDATE quests SET completionemote1 = '4' WHERE entry = 4295;
UPDATE quests SET CompletionText = 'Another one of Kaltunk\'s recruits, hm?$b$bA sorry state of affairs we find ourselves in if this is the best the Horde can produce. No matter. By the time we think you\'re ready to leave the Valley, you\'ll be a proud warrior of the Horde.' WHERE entry = 4641;
UPDATE quests SET detailemote1 = '1', detailemote2 = '1', detailemote3 = '1' WHERE entry = 5156;
UPDATE quests SET CompletionText = 'That\'s true.  I\'m looking for someone to hunt me some sick wolves!  Are you that person?' WHERE entry = 5261;
UPDATE quests SET CompletionText = 'I\'m glad you\'ve arrived, $N. There are many things we will have to discuss, but more importantly is your training in the ways of the Light. There are lessons all servants of the Light must learn. If you are ready, we\'ll begin discussing some of those now.' WHERE entry = 5634;
UPDATE quests SET CompletionText = 'I\'m glad you\'ve arrived, $N. There are many things we will have to discuss, but more importantly is your training in the ways of the Light.$B$BThere are lessons all servants of the Light must learn. If you are ready, we\'ll begin discussing some of those now.' WHERE entry = 5637;
UPDATE quests SET CompletionText = 'I\'m glad you\'ve arrived, $N. There are many things we will have to discuss, but more importantly is your training in the ways of the Light.$B$BThere are lessons all servants of the Light must learn. If you are ready, we\'ll begin discussing some of those now.' WHERE entry = 5639;
UPDATE quests SET IncompleteText = 'Possessing a Cenarion beacon allows one to see a corrupted soul shard on those tainted beasts that are put down for the greater good.  I grind shards into a usable reagent that goes into making Cenarion plant salve.  We will use that salve to turn corrupted plants into healthy ones again.$B$BIn exchange for these shards, I will give you some Cenarion plant salves I have already prepared.' WHERE entry = 5887;
UPDATE quests SET IncompleteText = 'If you possess a Cenarion beacon while mining in Felwood, you will be able to see tainted vitriol that corrupts a vein of raw metal.  I know how to purify that vitriol and turn it into a reagent that goes into making Cenarion plant salve.  You will then use that salve on plants you find in the wild that need saving.$B$BIf you have collected any tainted vitriol, I\'ll give you some Cenarion plant salve I have already prepared.' WHERE entry = 5888;
UPDATE quests SET IncompleteText = 'The power of a disenchanted magical item is felt by the essence it creates.  I\'ve devised a way to turn raw essence used by enchanters into a suitable reagent for creating Cenarion plant salve.  You don\'t need a Cenarion beacon for this; any suitably disenchanted item that yields lesser nether essences will work.$B$BI just need a single lesser nether essence; in exchange, I will give you Cenarion plant salves.  The essence is extremely potent - a little definitely goes a long way!' WHERE entry = 5891;
UPDATE quests SET IncompleteText = 'Trust ol\' Smokey, $r. The reward will be worth it. These Argent Dawn folk don\'t mess around when it comes to payment.\r\n' WHERE entry = 6026;
UPDATE quests SET CompletionText = 'Yes, it is time, $c.' WHERE entry = 6072;
UPDATE quests SET CompletionText = 'Excellent, $N. You\'ve saved me a lot of work!$b$bBut don\'t think that I\'m not grateful!' WHERE entry = 6571;
UPDATE quests SET IncompleteText = 'We at the Darkmoon Faire do much walking.  We walk from one faire site to another... in fact, you\'ll never see us sitting down on the job!  So it is no surprise that we wear out quite a lot of boots!  We need boots that are both durable and stylish, and embossed leather boots fit that bill rather well.$B$BYou!  You\'re a leatherworker; make me embossed leather boots and I\'ll give you a Darkmoon Faire ticket for the work.' WHERE entry = 7881;
UPDATE quests SET IncompleteText = 'It takes a lot of work to be the strongest woman alive!  My weight set is getting too light and if I\'m to stay fit then I\'ll need more weights!$B$BDo you think you could bring me some weight stones?  If you do, then I\'ll give you a Darkmoon Faire ticket.' WHERE entry = 7889;
UPDATE quests SET IncompleteText = 'Yebb is developing a new attraction for the Zoo Bizarre, one that will drive people crazy with wonder, and delight!  But it will take a lot of work, and a lot of materials...$B$BThat includes copper modulators.  We need lots of modulators for the mechanical parts of the attraction.  Bring me copper modulators and I\'ll trade for them with a Darkmoon Faire ticket.' WHERE entry = 7894;
UPDATE quests SET IncompleteText = 'The first lesson in drawing a crowd is: lure them with gadgets and trinkets!  Can you help me?$B$BI need small furry paws to use for prizes.  You can find those on the cats of the Barrens or Darkshore....$B$BBring me some paws and I\'ll trade you a Darkmoon Faire ticket for them.' WHERE entry = 7899;
UPDATE quests SET CompletionText = 'I received reports of your exploits in Arathi Basin, $n.  Well done!  With those like you joining the struggles here, I have faith that we will one day retake our homelands.' WHERE entry = 8105;
UPDATE quests SET CompletionText = 'Very good work, $n!  An excited scout came to me with a report of your exploits.  We in the League of Arathor are very pleased!$b$bYou are swiftly becoming a local hero among the soldiers in the League, and today\'s deed once again proves your sterling reputation.' WHERE entry = 8114;
UPDATE quests SET CompletionText = 'You did it!  You took all of the bases!  Well done, $n!$b$bThere were those who doubted your chances, but I knew you could do it.  Thank you, and know that the League of Arathor holds you in high regard, just as the Defilers of the Forsaken must fear the very mention of your name!' WHERE entry = 8115;
UPDATE quests SET CompletionText = 'A Defiler scout came to me with a report of your success, $n.  Well done.$b$bAs you will learn, to win the battle for Arathi Basin, we must be ever vigilant and crush any attempts at Alliance expansion.  Do this, and our victory here is ensured.' WHERE entry = 8120;
UPDATE quests SET CompletionText = 'Good work, $n!  Your latest actions in Arathi Basin were quite difficult, and so their successes are quite praiseworthy.  The League of Arathor must be reeling from the last skirmishes in the basin, licking their wounds and, let us hope, rethinking their choice to fight here.' WHERE entry = 8121;
UPDATE quests SET CompletionText = 'The cries of the Alliance as you and your compatriots attacked them could be heard even from here, $n.  I can almost pity them for the pain and fear you delivered to their ranks.  Almost, but not quite.$b$bYour value to the Defilers is without question.  Your deeds in Arathi Basin have been most impressive, and have echoed among the chambers of Varimathras... and the Dark Lady herself.' WHERE entry = 8122;
