UPDATE quests SET IncompleteText = 'Let\'s not waste more of my precious time with jibber jabber, $r. It\'s time to focus on replenishing our dwindling fiery flux supply.$B$BWhat I\'m gonna need from you is the following:$B$B*Incendosaur scales.$B$B*Heavy Leather.$B$B*Coal.$B$BI\'ll take all that you can offer!$B$BAnd you\'ll do it fast if you wanna get in good with the Brotherhood.\r\n' WHERE entry = 8242;
UPDATE quests SET CompletionText = 'You\'ve certainly begun to prove yourself to us, $n.  As a reward, please take this care package!  Inside it you\'ll find rations and bandages that are usable only inside Arathi Basin.$b$bAs you continue to prove yourself inside the Basin, you\'ll find that these items will become available to you for purchase.  Rations become available when you are Friendly with us, and bandages when you are Honored.' WHERE entry = 8260;
