UPDATE quests SET CompletionText = 'Excellent.  We were in need of these, $n.  Good work.' WHERE entry = 8541;
UPDATE quests SET CompletionText = 'Excellent work, $n.  Without their tunnelers, the silithid will have a hard time repairing any damage inflicted to their hive\'s structure.  I assume you\'ll want a new task.' WHERE entry = 8687;
UPDATE quests SET CompletionText = 'Your deeds will be known to all, champion. They will sing your praises from Orgrimmar to the far reaches of the South Seas. All will know of the champion of the Bronze Flight, $n.' WHERE entry = 8741;
UPDATE quests SET CompletionText = 'Greetings, champion. I am Jonathan, keeper of the sacred gong and eternal watcher of the Bronze Flight.$B$BI have been empowered by the Timeless One himself to grant you an item of your choosing from his timeless treasure trove. May it aid you in your battles against C\'Thun. ' WHERE entry = 8745;
UPDATE quests SET IncompleteText = 'Impressive, little one. You have gone through much trouble to gain the favor of the Bronze Flight. Your dedication is noted.$b$bThe signet ring of the defender will offer superior protection against the forces of evil.$b$bBe warned, once you have chosen your path, you will have no recourse should you change your mind.' WHERE entry = 8747;
UPDATE quests SET CompletionText = 'Your rise amongst the rank of the Brood is most impressive, $n. May you never stray from the path of the protector!' WHERE entry = 8748;
UPDATE quests SET CompletionText = 'Your rise amongst the rank of the Brood is most impressive, $n. May you never stray from the path of the protector!', IncompleteText = 'You honor my kind, $N. Strike down the enemies of Kalimdor! Show them what it means to deface the land of eternal starlight.$b$bYou have earned another enhancement. Hand me your signet ring so that I may bolster its power.' WHERE entry = 8749;
UPDATE quests SET CompletionText = 'Your rise amongst the rank of the Brood is most impressive, $n. May you never stray from the path of the protector!', IncompleteText = 'Dedication of this magnitude is a rarity. You have shown that your will is unfaltering, $N. You shall be greatly rewarded for your stalwart watch over our world.$b$bHand me your signet ring so that I may strengthen its enchantment.' WHERE entry = 8750;
UPDATE quests SET IncompleteText = 'Impressive, little one. You have gone through much trouble to gain the favor of the Bronze Flight. Your dedication is noted.$b$bThe signet ring of the conqueror will greatly enhance your physical attacks.$b$bBe warned, once you have chosen your path, you will have no recourse should you change your mind.' WHERE entry = 8752;
UPDATE quests SET CompletionText = 'Your rise amongst the rank of the Brood is most impressive, $n. May you never stray from the path of the conqueror!' WHERE entry = 8753;
