UPDATE quests SET CompletionText = 'Your rise amongst the rank of the Brood is most impressive, $n. May you never stray from the path of the conqueror!', IncompleteText = 'Dedication of this magnitude is a rarity. You have shown that your will is unfaltering, $N. You shall be greatly rewarded for your stalwart watch over our world.$b$bHand me your signet ring so that I may strengthen its enchantment.' WHERE entry = 8755;
