UPDATE quests SET CompletionText = 'Why, yes... these will be of tremendous aid!  These materials are awfully hard to come by in the desert, $n.  Thank you.' WHERE entry = 8779;
UPDATE quests SET CompletionText = 'Oh, excellent!  I won\'t have to hear complaints about dull blades anymore.  Thank you, $n.' WHERE entry = 8781;
UPDATE quests SET CompletionText = 'Ah, we were in need of these.  Your work is appreciated, $n.' WHERE entry = 8782;
UPDATE quests SET CompletionText = 'Ah, yes.  These materials are of excellent quality.  Thank you, $n.' WHERE entry = 8783;
UPDATE quests SET CompletionText = 'Ah, we were in need of these.  Your work is appreciated, $n.' WHERE entry = 8808;
UPDATE quests SET CompletionText = 'Ah, yes.  These materials are of excellent quality.  Thank you, $n.' WHERE entry = 8809;
UPDATE quests SET CompletionText = 'Just in time.  These supplies will save lives, $n.  Your work is appreciated.  Here\'s your next assignment.' WHERE entry = 8810;
UPDATE quests SET CompletionText = 'Yes, I believe these shall suffice.  I shall craft these into the colors worn by the Twilight Hammer\'s emissaries.  I pray to Elune that my skills will be able to fool our enemies once more.$b$bBut do not be concerned with that, you\'ve done your part and for that you will be appropriately rewarded.  You are a loyal and worthy ally, $n.' WHERE entry = 8829;
UPDATE quests SET CompletionText = 'Well then, it\'s settled; here are your supplies, $C.  If you wish to do an additional exchange, then I am prepared to authorize it.  Just give me the word and I\'ll make it happen.$B$BKeep up the good work, $N.  We need all the materiel we can muster if we\'re going to win this thing.  If we all do our part, then victory shall be ours for the taking!' WHERE entry = 8846;
UPDATE quests SET CompletionText = 'Very well done, $n.  Defeating Omen sent his spirit back to the waters of Elune\'ara.  Although the beast himself is blessed by Elune and so cannot die, his anger will subside for another year.$b$bYour victory is a celebration, $n--a celebration of the might of Omen, of you and your allies, and of the peace you have given this tragic hero of our past.' WHERE entry = 8868;
UPDATE quests SET CompletionText = 'In all my days of living I would have never expected to see this...$b$b<Father Montoy appears to be salivating.>$b$bOh yes, you will be rewarded dear $g. You will be greatly rewarded. Give it here. Now!' WHERE entry = 9120;
UPDATE quests SET IncompleteText = 'For every armful of the scraps, I\'ll give you an insignia - the more the better. Now get out of my sight before I split you in two!\r\n' WHERE entry = 9132;
UPDATE quests SET CompletionText = 'Darenis sent you?  Very well, I suppose we can use your aid in fighting Dar\'Khan\'s forces.' WHERE entry = 9151;
UPDATE quests SET IncompleteText = 'If it were not for these Argent Dawn guards, you would be a stain upon this floor.\r\n' WHERE entry = 9211;
UPDATE quests SET CompletionText = 'Simply by answering the call, we are in your debt, $n. The Argent Dawn is certain that through your shining example, others that are here to aid us will gain great insight into how best to throw back this Scourge Invasion!' WHERE entry = 9247;
UPDATE quests SET CompletionText = '$N, by my eternal soul, it is good to see you!  I don\'t know why the Exodar crashed.  Only those of us that were in this part of the ship remain.$B$BThere\'s not much time if we\'re to save everyone that we can!' WHERE entry = 9279;
UPDATE quests SET CompletionText = 'Regrettable that those creatures had to die so that we might live - indiscriminate killing is not the draenei way.  However, the blood you gathered will replenish our healing crystals, so their deaths will not be in vain.' WHERE entry = 9280;
UPDATE quests SET CompletionText = 'The Light be praised! You\'ve done what only a true $g hero : heroine; could have done, $N! The draenei you saved owes their continued life to your selflessness!$B$BPlease, take this supply pouch. You look like you can use it more than I.' WHERE entry = 9283;
UPDATE quests SET CompletionText = 'I am heartened by your initiative to speak with me.  In the past I was responsible for the training of young paladins as they entered our order.  This is a duty and privilege that I humbly take up once more.  Your name has been mentioned as one who seeks to do good in the name of the Light.  It would be my honor to guide you in your first steps as a paladin.$B$BShall we begin?' WHERE entry = 9287;
UPDATE quests SET CompletionText = 'These will do. Thank you, $c!$B$BWhile you were out, I managed to gather some equipment together to make an analysis of the samples.  This should only take a moment.', IncompleteText = 'I\'ll need all of the samples in good condition if we\'re to have a chance of cleansing the lake.$B$BWe don\'t have much time, $c!' WHERE entry = 9293;
UPDATE quests SET CompletionText = 'How tragic. These words, clearly meant for someone the soldier loved, never made it to their destination. The events detailed happened years ago; I\'m not sure if the intended recipient still lives.$b$bThere is hope yet, however. With the names and information he gives, I might be able to locate the family! It will take some research, but the librarian in Stormwind owes me a favor...$b$bThank you for bringing this to me. With your help, we may be able to grant someone peace of mind at last.' WHERE entry = 9295;
