UPDATE quests SET CompletionText = 'With many of the owlkin now inoculated, we can focus on getting out of here and not have to worry about wiping out the owlkin population in the area.$B$BHere, choose from these.  You\'ve done good work, and you deserve to be rewarded!', IncompleteText = 'The more we can do to clear up Nestlewood, the faster Zhanaa can get back to work.' WHERE entry = 9303;
UPDATE quests SET CompletionText = 'How tragic. These words, clearly meant for someone the soldier loved, never made it to their destination. The events detailed happened years ago; I\'m not sure if the intended recipient still lives.$b$bThere is hope yet, however. With the names and information he gives, I might be able to locate the family! It will take some research, but the librarian in Stormwind owes me a favor...$b$bThank you for bringing this to me. With your help, we may be able to grant someone peace of mind at last.' WHERE entry = 9304;
UPDATE quests SET CompletionText = 'Let me take a look at those.$B$BYes, I think that these will do nicely; good job, $N. The emitter is rather complex so it may take some time to finish the repairs. I\'ll let you know when it\'s ready.$b$bIn the meantime, you might see if Vindicator Aldar has anything he could use you for.' WHERE entry = 9305;
UPDATE quests SET CompletionText = 'Help... blood elves!  They... ambushed... me.  Don\'t have... long.' WHERE entry = 9309;
UPDATE quests SET CompletionText = 'I thank you for dealing with the blood elf surveyor.  Surely she was their leader.  Rest assured, we will deal with whatever remnant of them is still nearby.$B$BPlease, take one of these weapons as a sign of my gratitude.' WHERE entry = 9311;
UPDATE quests SET CompletionText = 'I got it, I got it!  I think I managed to fix the emitter!  Here, I\'ll just activate this last crystal and that should do it.$B$BTake a look at the emitter, $N.  It looks like it\'s beginning to work... someone is appearing!' WHERE entry = 9312;
UPDATE quests SET CompletionText = 'Ah, good to see you again!  I\'m glad that we were both able to get our emitters fixed or we might never have found one another.  And don\'t worry, we\'ll see to it that Ammen Vale gets help and supplies.$B$BSpeaking of assistance, now that you\'re here, go around and introduce yourself to the others.  I know that there\'s plenty to do.' WHERE entry = 9313;
UPDATE quests SET CompletionText = 'Oh, you must be one of the survivors we\'ve been hearing about!$b$bI\'m glad that you came. Don\'t worry, we will send someone to see to Aeun\'s injured leg.$B$BI\'m most interested in hearing all about your harrowing story of survival. You\'re a brave one to have made it all the way here.' WHERE entry = 9314;
UPDATE quests SET CompletionText = 'You\'ve proven yourself, today, $n.$b$bWhile I have little else to give you, I do have this crown; a fitting gift for a conqueror. May it light your way.' WHERE entry = 9339;
UPDATE quests SET CompletionText = '<Grelag winces as he tries to stand up.>\r\n\r\nI should\'ve followed Far Seer Regulkut\'s advice and waited for the bodyguards she was going to send with me. I\'m fortunate that she thought to send someone after me.\r\n\r\nI wouldn\'t have been able to make it back to Thrallmar on my own. I\'ve been doing what I can for this leg, but without my supplies, the outlook is grim.' WHERE entry = 9344;
UPDATE quests SET CompletionText = 'You\'ve proven yourself, today, $n.$b$bWhile I have little else to give you, I do have this crown; a fitting gift for a conqueror. May it light your way' WHERE entry = 9365;
UPDATE quests SET IncompleteText = 'Hello, $c.  What have you there? Is it for me?' WHERE entry = 9409;
UPDATE quests SET IncompleteText = 'What do you think of my armor? Crafted it myself! It\'s a little different than what we\'d traditionally wear but extremely comfortable.\n' WHERE entry = 9453;
UPDATE quests SET CompletionText = 'Well done, $n, well done!$b$bHere, I cooked up some tenderloins while you were gone. Maybe you\'d like the recipe, too?', IncompleteText = 'The stag hides are frail which tend to make for tender, succulent flesh.' WHERE entry = 9454;
UPDATE quests SET IncompleteText = 'Do not waste time, $g boy:girl;.' WHERE entry = 9473;
UPDATE quests SET CompletionText = 'You\'re a resourceful one! With our navigation gear, we can figure out just how far we\'ve veered off course.$b$bBut wait, what\'s this? There\'s something rolled up in the map. Let me see...$b$bThese are orders from Mogul Razdunk of the Venture Company. According to these plans, they\'re here to strip-mine the island of the crystal wreckage, then hijack our ships once they\'re finished.$b$bBy Bronzebeard\'s bushy brow! This is why they forced us to land? How could they know of our plans?$b$bI smell a traitor...', IncompleteText = 'Any luck, stranger?\n' WHERE entry = 9506;
UPDATE quests SET CompletionText = 'Bless yer heart, stranger. This\'ll go a long ways in liftin\' the morale o\' the crew.\n', IncompleteText = 'Arrr... Yarr... Shiver me timbers... Er, sorry $g lad:lass;, I gotta practice me pirate lest I forget it...' WHERE entry = 9512;
UPDATE quests SET CompletionText = 'My pappy would be proud! His boy strikes it big at the first set of night elf ruins he comes across... With your help, of course. Yes, don\'t worry, I won\'t leave you out of the discovery. Your name is $N, right? They\'ll learn all about you in Ironforge.\n', IncompleteText = 'Don\'t come back without some ancient relics.\n' WHERE entry = 9523;
UPDATE quests SET CompletionText = '<Tears of joy stream down Cowlen\'s face.>$B$BHow can I ever repay you for this, $N? Please, take this heirloom. It symbolizes a sacred bond of friendship, trust and love amongst night elves. You are a $g brother:sister; to me - from this day until the end of time...' WHERE entry = 9528;
UPDATE quests SET CompletionText = 'I can\'t believe it! It was the gnome all along... I should have known!' WHERE entry = 9531;
UPDATE quests SET CompletionText = 'Incredible! This was all part of their master plan!$B$BThis information must reach the king and your own leaders. The implications are staggering.\n' WHERE entry = 9537;
UPDATE quests SET CompletionText = '[Furbolg] The prophecy spoke of one that would rise and deliver us from the oppressive grasp of Bristlelimb -- that the spirits themselves would herald the arrival of this hero.$B$BAnd now, you have come.$B$BI humble myself before you, great one.' WHERE entry = 9544;
UPDATE quests SET IncompleteText = 'Tell me you haven\'t come back empty-handed. $N.' WHERE entry = 9773;
UPDATE quests SET CompletionText = 'These look like fine specimens.  Thank you for performing the field work.  Once I can find the time to analyze these, I should be able to tell what it will take to restore the fields.', IncompleteText = 'Hello, $c.  Do you have those flowers yet?' WHERE entry = 9799;
UPDATE quests SET IncompleteText = 'The Earthen Ring will help in any way possible.\r\n' WHERE entry = 9810;
UPDATE quests SET CompletionText = 'It is done then. The foul traitor got what he deserved.$b$bYou\'ve been of great service to the blood elves and to the Horde. Dar\'khan was Thrall\'s excuse to deny them entry into our alliance. You\'ve cleared the way for a new Horde, $c.$b$bI also see that Lor\'themar has additional news that will greatly improve his relations with Thrall. Excellent!' WHERE entry = 9812;
UPDATE quests SET CompletionText = 'The Earthen Ring thanks you, $N. The elements also give their thanks. Your continued efforts in cleansing our world are appreciated and noted.\r\n' WHERE entry = 9815;
UPDATE quests SET CompletionText = 'Amid the wreckage of the merchant\'s cart and goods, sets of strange footprints are visible. The footprints appear to have come from an overgrown bird.\r\n\r\nRecalling what you know about the arakkoa, you conclude the print is large enough to belong to one of the sentient bird-people who make their homes in the forest. Why would they have taken to attacking Horde merchants?' WHERE entry = 9929;
UPDATE quests SET CompletionText = 'Amid the wreckage of the merchant\'s cart and goods, sets of strange footprints are visible. The footprints appear to have come from an overgrown bird.\r\n\r\nRecalling what you know about the arakkoa, you conclude the print is large enough to belong to one of the sentient bird-people who make their homes in the forest. Why would they have taken to attacking Alliance merchants?' WHERE entry = 9930;
UPDATE quests SET CompletionText = '<Thander nods as you tell him about your findings in the arakkoa settlement.>\r\n\r\nThere\'s no doubt that they\'re involved, then. But why?\r\n\r\nDeirom has been making the trip to Shattrath without incident for some time. Why would the arakkoa choose this trip to take him captive?' WHERE entry = 9943;
UPDATE quests SET CompletionText = 'Thirty orcs, $r! Of those original thirty, only Ungriz and I remain. We found the young orc, Saurfang, nearly dead near Sunspring. Apparently he was here for another reason...\r\n' WHERE entry = 9944;
UPDATE quests SET CompletionText = '<Rokag nods as you tell him about your findings in the arakkoa settlement.>\r\n\r\nThere\'s no doubt that they\'re involved, then. But why?\r\n\r\nDugar has been making the trip to Shattrath without incident for some time. Why would the arakkoa choose this trip to take him captive?' WHERE entry = 9947;
UPDATE quests SET CompletionText = 'Odd, these eyes are not exactly what I am used to working with.  The manner in which the arakkoa use their magic is slightly different than ours.$B$BIt looks like we\'re going to need one more thing if I\'m going to be able to scry for the information to locate Deirom.' WHERE entry = 9949;
UPDATE quests SET CompletionText = 'Their defenses are much more sophisticated than I\'d thought, $N. That\'s a bad sign. Fortunately, for every good spell, there\'s a counterspell. It\'s just a question of getting our hands on that counter.' WHERE entry = 9958;
UPDATE quests SET CompletionText = 'Their defenses are much more sophisticated than I\'d thought, $N. That\'s a bad sign. Fortunately, for every good spell, there\'s a counterspell. It\'s just a question of getting our hands on that counter.' WHERE entry = 9959;
UPDATE quests SET CompletionText = 'So, I was right.  That was the corpse of one of the Broken?  And you can confirm that there was a strange object on the ground next to him?$B$BThis doesn\'t make any sense.  What would one of the Broken be doing here?  And what is that thing it had with him?$B$BIs it was caused all of this death?' WHERE entry = 9971;
UPDATE quests SET CompletionText = 'I must admit, $N, I\'m pleasantly surprised. When Thander told me that Deirom was being held in Veil Shalas, I began to wonder whether he was lost to us for good.$B$BThis is one time I\'m very happy to have been proven wrong.$B$BYou can bet we\'ll be keeping a closer eye on the activities of the arakkoa after this.' WHERE entry = 9980;
UPDATE quests SET CompletionText = 'I must admit, $N, I\'m surprised. When we found out that Dugar was being held in Veil Shalas, I began to wonder whether he was lost to us for good.$B$BThis is one time I\'m happy to be proven wrong.$B$BYou can bet we\'ll be keeping a closer eye on the activities of the arakkoa after this.' WHERE entry = 9981;
UPDATE quests SET CompletionText = 'I can read most of this, enough to get a general idea. Whoever wrote this is praising the \'progress\' made by Luanga and encouraging him to continue interrogating his \'guests.\'$b$bMeanwhile, it says, \'the preparations in Skettis are proceeding as planned\' and that they will \'soon be ready to reclaim their ancestral lands.\'$b$bI\'m not familiar with this \'Skettis\' mentioned by the writer, but wherever it is, it sounds like the arakkoa are assembling an army there! Thander must be told about this immediately.' WHERE entry = 9984;
UPDATE quests SET CompletionText = 'I can read most of this, enough to get a general idea. Whoever wrote this is praising the \'progress\' made by Luanga and encouraging him to continue interrogating his \'guests.\'$b$bMeanwhile, it says, \'the preparations in Skettis are proceeding as planned\' and that they will \'soon be ready to reclaim their ancestral lands.\'$b$bI\'m not familiar with this \'Skettis\' mentioned by the writer, but wherever it is, it sounds like the arakkoa are assembling an army there! Rokag must be told about this immediately.' WHERE entry = 9985;
UPDATE quests SET CompletionText = 'These will work, although I\'m sure the men will start to complain about the lack of variety soon. Light forbid they should look the same!$B$B<Ros\'eleth gasps in mock horror.>$B$BOh, no, we can\'t have that! ' WHERE entry = 9988;
UPDATE quests SET CompletionText = 'These will work well. The more individuals you collected them from, the more they will help me when I try to contact the arakkoa spirits. Thank you for your help, $N. ' WHERE entry = 9989;
UPDATE quests SET CompletionText = 'Good work!$B$BLet me have a look at those code sheets.  I\'ve got an idea and it might just be crazy enough to work!  ' WHERE entry = 10014;
UPDATE quests SET CompletionText = 'Excellent! Now just a few adjustments and this thing will be as good as new. Oh yes, your key! Here you go.$B$BBy the way, the Jump-a-tron still has a few kinks that I need to work out. Um, just be careful.\r\n' WHERE entry = 10109;
UPDATE quests SET CompletionText = 'I am relieved to hear that he is safe. Have you come to join the hunt?\r\n' WHERE entry = 10114;
UPDATE quests SET CompletionText = 'Well done, $N. These orders should finally reveal the identity of the mastermind behind these attacks.' WHERE entry = 10138;
UPDATE quests SET CompletionText = 'These are great! Don\'t be surprised if you see a bunch of men walking around in feathered hats very soon! ' WHERE entry = 10195;
UPDATE quests SET CompletionText = '<Zuben Elgenubi flashes what could be considered an ethereal grin.>$B$BI pledge to only use this incredible firepower for good. The good of my profit margin, that is.  ' WHERE entry = 10292;
UPDATE quests SET CompletionText = 'You\'re finished? That\'s good news. Hopefully, we can find a way to avoid the killing of these mutated beasts in the future.$b$bI believe I have formed a plan that might give us an alternative solution to this problem, but I will need your help.' WHERE entry = 10302;
UPDATE quests SET CompletionText = 'Wonderful! You\'re turning into quite the hunter, $n.$b$bHow would you like to look more like me? Well here is your chance! While you were out hunting, I fashioned these items out of some buck hides I had laying around. Take your pick!' WHERE entry = 10324;
UPDATE quests SET completionemote1 = '1', completionemote2 = '1', completeemote = '6' WHERE entry = 10426;
UPDATE quests SET detailemote1 = '1', detailemote2 = '1', completionemote1 = '1', completionemote2 = '1', completeemote = '1' WHERE entry = 10427;
UPDATE quests SET CompletionText = 'My family... What have I done... What could I have done?$b$bWhy must I be punished so?' WHERE entry = 10428;
UPDATE quests SET detailemote1 = '1', detailemote2 = '1', detailemote3 = '1' WHERE entry = 10429;
UPDATE quests SET RequiredQuest1 = '10668', RequiredQuest2 = '10669' WHERE entry = 10646;
UPDATE quests SET CompletionText = 'I\'m glad you survied!  You\'re the first!' WHERE entry = 10716;
UPDATE quests SET CompletionText = 'A key mold?  Could this be what grants us access to the Shattered Halls?' WHERE entry = 10755;
UPDATE quests SET CompletionText = 'Nazgrel wants me to work on a key?  Does he forget we\'re in a battlefield?  There are blades and spears to forge!' WHERE entry = 10756;
UPDATE quests SET CompletionText = 'Excellent.  Let\'s give it a shot.' WHERE entry = 10757;
UPDATE quests SET CompletionText = 'You\'ve succeeded!  Only thing left for you to do is try it out.', IncompleteText = 'Did you do what I asked of you, $c?' WHERE entry = 10758;
UPDATE quests SET detailemote1 = '396', detailemote2 = '396', detailemote3 = '396', completionemote1 = '396', completionemote2 = '396', completionemote3 = '396', completeemote = '396' WHERE entry = 10847;
UPDATE quests SET detailemote1 = '396', detailemote2 = '396', detailemote3 = '396', completionemote1 = '396', completionemote2 = '396', completionemote3 = '396', completeemote = '396' WHERE entry = 10849;
UPDATE quests SET detailemote1 = '396', detailemote2 = '396', detailemote3 = '396' WHERE entry = 10908;
UPDATE quests SET CompletionText = 'Hmph, you\'re my sponsor?  I\'m Salandria!  I\'ve been here ever since I was a little baby.  My parents were taken by the war, so I have to live here at the orphanage.$b$bIt\'s not that bad, but I always wanted to go places -- I haven\'t ever stepped foot outside of the city.  I\'ve already made a list of all the cool places that I want to go, and the awesome things that I want to do.$b$bI\'m ready to go when you are!' WHERE entry = 10942;
UPDATE quests SET CompletionText = 'You must be the adventurer who\'s going to be my big brother for Children\'s Week!  I\'m Dornaa, pleased to meet you.$b$b<She looks sad for a moment.>$b$bMother and father were killed in the war, and I\'ve lived in the orphanage all my life.  It\'s nice, actually, but I\'ve always wanted to go places and see things.$b$bI\'ve already made a list of places we could visit, if that\'s okay?  I just know that we\'re going to have a great time together!$b$bI\'m ready to go when you are!' WHERE entry = 10943;
UPDATE quests SET CompletionText = 'Thank you for this chance to once again see Salandria.  I have missed her so much this past year, but we are still good friends.$b$bWe agreed that when we grow up, we\'re both going to be brave adventurers, just like you!' WHERE entry = 10945;
UPDATE quests SET CompletionText = 'Oh, it\'s just wonderful!  I mean, it looks pretty old... and yeah, someone sure did blow it up.  But just look at it!$b$bOoh, and did you look up at the sky?$b$bNeato!' WHERE entry = 10950;
UPDATE quests SET CompletionText = 'The stories don\'t even come close to how cool this place is.  It\'s amazing!$b$bIs it true that a powerful wizard named Medivh created it?$b$bI wonder what\'s on the other side?  You\'ve been there, right?  Hmm, we should definitely go someplace on the other side of the Dark Portal!' WHERE entry = 10951;
UPDATE quests SET CompletionText = 'The orphan matron\'s stories don\'t even come close to how cool this place is.  It\'s amazing!  She said that it was created by a powerful wizard named Medivh.$b$bWhat\'s on the other side of it?  You\'ve been there, right?  We should most definitely go someplace on the other side of the Dark Portal!' WHERE entry = 10952;
UPDATE quests SET CompletionText = 'You bring a child here?  Foolhardy, but I promise that she will come to no harm, at least as long as she doesn\'t get too close to Incineratus.$b$bHmm, unfortunate that she\'s a blood elf.  Were she capable of a deep connection to the world, we could teach her some things so that she might aid us to heal its wounds.  But, perhaps her exposure to the elements here will give her some insight into their workings.$b$bGo in peace and see to it that you take good care of her.' WHERE entry = 10953;
UPDATE quests SET CompletionText = 'Oh, I\'ve missed Dornaa so much.  Thank you for bringing her to visit.  It gets lonely here with only the ethereal around.  And they\'re so serious all the time with this Oshu\'gun business.$b$bBut I get to go back and visit the orphanage after I pass my gemcutting exams.  I almost passed them last week, but I\'m sure that I\'ll do better on the test tomorrow!' WHERE entry = 10954;
UPDATE quests SET CompletionText = '<You feel, more than hear, the musical voice of O\'ros chiming in your mind.>$b$bThank you for bringing this child to me, $n.  She is very special indeed, and will grow up one day to be an important figure amongst the draenei.  This is in no small part due to the kindness that you have shown her, and the impression that you have made.' WHERE entry = 10956;
UPDATE quests SET CompletionText = 'There are so few that are gifted enough to be able to channel such power from M\'uru.  To see this in a child is truly amazing!$b$bIt was wise of you to bring her before me.$b$bYou say that she\'s an orphan in Shattrath City?  I shall see to it that a petition is submitted to the orphan matron there so that she might be remanded to our custody for proper training.  She belongs with us, here.$b$bSee to it that you keep her safe until then.' WHERE entry = 10960;
UPDATE quests SET CompletionText = 'I had hoped, but despaired she was only a figment of my imagination.  The child is amazing!$b$bIt\'s unheard of in this day and age that one of the draenei should exhibit such ability with the elements without any training.  She must have inherited this power from an ancient ancestor.$b$bI will send a missive to the orphan matron in Shattrath City requesting that the child be allowed to come stay with us.$b$bPlease, keep her safe until then.' WHERE entry = 10968;
UPDATE quests SET CompletionText = 'Word has gotten back of your heroics, $n. Haramad and I both agree that what you\'ve done deserves a great reward.$b$bThough... Nevermind, you\'ve done enough. I cannot in good conscience ask anything more from you.' WHERE entry = 10977;
UPDATE quests SET CompletionText = 'Thanks a lot for your help!  As long as Brewfest is going and the Dark Iron dwarves are attacking, I\'ll need some help shipping kegs.  So if you want to work for more tokens, talk to me every day.$b$bBut enough about that, I need to pay you for the job you just did.  Here are your tokens, have fun at Brewfest!', IncompleteText = 'I need those kegs!  So, what are yeh waitin\' for!?!' WHERE entry = 11122;
UPDATE quests SET RequiredQuest1 = '11247', RequiredQuest2 = '11246', RequiredQuest3 = '11245' WHERE entry = 11250;
UPDATE quests SET CompletionText = '<Chieftain Ashtotem breathes a sigh of relief.>$B$BThat should take some of the pressure off.$B$B$N, time and again you have proven your value to the taunka of Camp Winterhoof. Please, choose something from our bounty. I insist.' WHERE entry = 11264;
UPDATE quests SET CompletionText = 'Well done!  That kinda shouting is sure to bring business our way.$b$bAnd we promised you a reward, here it is.  The Barleybrews keep their word.$b$bOh, and come back any other day if you want to help spread the good name of Barleybrew.' WHERE entry = 11293;
UPDATE quests SET CompletionText = 'Nice work there!  It takes time to get the hang of controlling your ram.  But once you do, you\'ll wish every ram was a racing ram.$b$bWhat\'s that? \"Where\'s my reward?\"  Ha Ha Ha... you got to ride the fastest ram around!  You want more?  Well how about this...$b$bYou\'ve been rewarded with the chance to help other people around Brewfest.  There\'s plenty of work, and rewards, for an eager, young, ram racer.' WHERE entry = 11318;
UPDATE quests SET CompletionText = 'Garwal was not a worg at all! I know of these creatures... they are called worgen.$B$BBut, Ulfang indicated that it came south from the Grizzly Hills? Odd. There aren\'t any worgen there.$B$BI thank you for helping to restore Ulfang to his proper place amongst his pack. Now we both will be able to sleep peacefully.$B$BPlease, you must accept this as a sign of gratitude.', IncompleteText = '$N, you have returned. What news of Ulfang?' WHERE entry = 11324;
UPDATE quests SET CompletionText = '<Anastasia turns and smiles at her succubus.>$B$BVery well, $N, I concede that you have certainly earned a choice of one of these.' WHERE entry = 11399;
UPDATE quests SET CompletionText = '<Ulfang howls loudly at your defeat of his great eagle enemy.>$B$BThe honor of the kill is yours. I wish that it had been my maw to finally close upon her neck.$B$BLet us not waste the sacrifice that she has made for us. Here, eat them!' WHERE entry = 11417;
UPDATE quests SET CompletionText = 'That\'s enough for today. Slow and steady is the key here. Too much disruption and they\'d turn their attention directly upon us; something that we don\'t want.$B$BCome back again tomorrow and we\'ll work on it some more.', completionemote1 = '274', completionemote2 = '1' WHERE entry = 11541;
UPDATE quests SET CompletionText = 'A hero of the Horde, eh?$B$B<Garrosh sniffs at the air around you.>$B$BFear...$B$B<Garrosh spits.>$B$BYou won\'t last long.' WHERE entry = 11585;
UPDATE quests SET ReqCastSpellId1 = '45607' WHERE entry = 11637;
UPDATE quests SET RequiredTradeskillValue = '1' WHERE entry = 11934;
UPDATE quests SET CompletionText = 'What you see here is all that remains of the taunka from the Borean Tundra and the Dragonblight. They are a broken people... battered and brought to the brink of extinction.$B$B<Brighthoof shakes her head.>$B$BOnly the Horde can save them now. Only the Horde can mend their broken spirits. We will nurse them back to full health and they will in turn strengthen the Horde in Northrend.\n' WHERE entry = 11979;
UPDATE quests SET IncompleteText = 'You have returned.  What did you uncover?' WHERE entry = 11999;
UPDATE quests SET CompletionText = 'That\'s alright, $c, just put them down on the ground there in front of Agmar\'s throne.$B$B<You can practically sense the smile hidden behind the archmage\'s helm.>$B$BUnfortunate that Goramosh indicated the accord had already been reached.$B$BNonetheless, that\'s two less worms we\'ll have to worry about. Let us get on to more important business.' WHERE entry = 12005;
UPDATE quests SET CompletionText = 'So you managed to stop the Dark Irons... While drunk too?  That, $c, is truly the spirit of Brewfest!  I guess in keeping with the spirit of Brewfest you want your prize tokens.$b$bThanks for your help, $n.  Enjoy the rest of Brewfest.' WHERE entry = 12020;
UPDATE quests SET CompletionText = 'Do you know what that was?  Gnomish engineering at its finest!  S.T.O.U.T. took the abuse like a champ!$b$bI think you\'re ready now to take on the Dark Irons if they show up again.', completionemote1 = '4' WHERE entry = 12022;
UPDATE quests SET CompletionText = 'WHAT?!$B$B<The image before you distorts for a moment as the archmage attempts to regain his composure.>$B$BOf course, we should have guessed that this was what they were up to all along. Quickly, there\'s no time to waste.$B$BWyrmrest must be warned!' WHERE entry = 12110;
UPDATE quests SET CompletionText = 'A letter of introduction to meet with the queen? Let me see that.$B$BWhatever your business is, I hope that it\'s important.  The skies are full of attacking blues today!' WHERE entry = 12122;
UPDATE quests SET CompletionText = 'Dahlia was taken by the Scourge? This is a sad day for all of us.$B$BI will look to finding a new keeper once the shrine is retaken. Thank you for your efforts... the Ruby Dragonshrine is a sacred place to us, and the sacrifices your kind have made will not be easily forgotten.$B$BIt is good to know there are still heroes such as you - I will call upon you one day. Until that day comes, may your adventures be fruitful.' WHERE entry = 12419;
UPDATE quests SET CompletionText = 'Dahlia... they turned her?$B$BDahlia has been loyal to us for a very long time... if they can corrupt a being of her devotion, it does not bode well for the rest of the young races. Thank you for freeing her. I hope she has found some peace.$B$BYou have honored us with your selfless assistance today, $r. Perhaps not all of the Horde bear the black hearts of their ancestors.  I will send word to the council of what your kind have accomplished here.' WHERE entry = 12450;
UPDATE quests SET CompletionText = 'So Krenna sent you to me?  She must\'ve not liked you very much, but then again who does she like?$B$BCracking this vrykul outpost is going to be a tough, tough job.' WHERE entry = 12468;
UPDATE quests SET CompletionText = 'This is the Coren Direbrew\'s drink?  The brew he wanted more than anything to submit at Brewfest?  Well, officially we can\'t recognize this submission, but out of respect for a fallen brewer, perhaps I\'ll have a taste...', IncompleteText = '$N, your face has a grim set to it.  Do you have dire news?', completionemote1 = '6' WHERE entry = 12491;
UPDATE quests SET CompletionText = 'You did it!  You actually found it!$B$BI don\'t know... I don\'t know how to thank you!', IncompleteText = 'The ring, $N!  Please... tell me you\'ve found it!' WHERE entry = 12624;
UPDATE quests SET ExploreTrigger1 = '5052' WHERE entry = 12665;
UPDATE quests SET CompletionText = 'Rejek thanks you. Rejek drink, grow strong, always remember mighty $n\'s gift.' WHERE entry = 12732;
UPDATE quests SET CompletionText = 'You must be $N. I was told you\'d be coming.$B$B<The ambassador grunts.>$B$BI have something that I want you to take care of. If you do, you\'ll prove yourself to the dragons here.' WHERE entry = 12767;
UPDATE quests SET CompletionText = 'Back so soon, $N?$B$BVargastrasz sent word ahead of you. Thank you for what you did at the Ruby Dragonshrine.' WHERE entry = 12769;
UPDATE quests SET ReqCastSpellId1 = '54530' WHERE entry = 12843;
UPDATE quests SET CompletionText = 'Quickly, hand them to me and stay out of sight!$B$BThe rod, the hook, and the rope are all very self-evident in their usage when combined. I just need to infuse the result with the essences and we\'ll be ready to proceed.$B$BIt\'s all very mundane in its composition, but extraordinary in its application!' WHERE entry = 12891;
UPDATE quests SET CompletionText = 'Perhaps now we can really get something done. Don\'t be fooled though, the Lich King can still \'see\' through his Scourge minions.$B$BThat\'s why you\'re here.' WHERE entry = 12892;
UPDATE quests SET CompletionText = 'We will put those three to good use once we finally take the vault.$B$BSpeaking of which....' WHERE entry = 12893;
UPDATE quests SET CompletionText = 'I was worried for a while there, $N. When he busted out the seals and penguins... Well, I didn\'t know what to think to be honest. It looked pretty damn ridiculous.' WHERE entry = 12935;
UPDATE quests SET CompletionText = 'Damn, I remember Korrak from way back in my younger days when I used to work for the Frostwolf Clan. He would never shut up! I think you just did the world a great service, $N.' WHERE entry = 12936;
UPDATE quests SET CompletionText = 'It\'s a pleasure to finally meet you, $N. We owe you a great deal, but we\'re not done with you yet.$B$BThere is a vrykul city just over the mountains to the west, a place called Jotunheim.$B$BThe vrykul there are in a constant state of challenge to \'ascend\'. The winners go to Ymirheim to serve as the Lich King\'s elite warrior caste, the Ymirjar, and the losers are reduced to scourged Vargul.$B$BYou are going to be my instrument to see to it that more Vargul than Ymirjar emerge.' WHERE entry = 12938;
UPDATE quests SET CompletionText = 'Already I\'m hearing reports of the prowess you displayed on the Savage Ledge. Excellent, $N... excellent!$B$B<The duke flashes his rictus smile again and you can almost hear the wheels in his head turning.>$B$BAnd now I think it\'s time to issue a decree to the thane of those vrykul that you so easily defeated.' WHERE entry = 12939;
UPDATE quests SET CompletionText = '<Duke Lankral nods his approval at your report of success.>$B$BWe face a foe that dwarfs us, not only in stature, but also numerically. If we are to win the battle for Icecrown, we must outthink them!$B$BWith Ufrang dead, that gives us an advantage in Jotunheim. Let us see if we can capitalize on it.' WHERE entry = 12943;
UPDATE quests SET CompletionText = 'You did it, $N! That was the most exciting fight yet! What are you going to do with your winnings? Me? I\'m going to Dalaran and blowing it all in the Underbelly. Lot of hot action going on down there!' WHERE entry = 12948;
UPDATE quests SET IncompleteText = 'No payout until the fight\'s over, $g man:lady;.' WHERE entry = 12954;
UPDATE quests SET CompletionText = 'That was important, $N. By driving them off, you\'re keeping them from interfering with whatever we need you to do over there.' WHERE entry = 12955;
UPDATE quests SET CompletionText = '$N, you came.$B$BAlready I have heard of your activities on the Savage Ledge. This is good. I am glad that you seem willing to help with undermining the vrykul here at Jotunheim.$B$B<The face of the witch breaks into a reluctant grin as if she\'s fighting the will of Lady Nightswood.>$B$BYou and I are going to have a great deal of fun with them!' WHERE entry = 12999;
UPDATE quests SET CompletionText = 'You discovered and put an end to the doctor\'s machinations.$B$B<The banshee-controlled witch smiles and places a large hand gently upon your shoulder.>$B$BThat\'s a fine poke in the eye for the Lich King, but I think we can do better.' WHERE entry = 13043;
UPDATE quests SET CompletionText = 'Thank you, $c... thank you!$B$BYou\'ve given me the satisfaction of knowing that the coward who made me into this will rot for all eternity as surely as I will.$B$BNow leave before I lose control of myself and cut you down.' WHERE entry = 13059;
UPDATE quests SET CompletionText = 'I have never seen such terror in the eyes of a vrykul. They think themselves masters of their world.$B$BYou and I are going to prove them wrong. Very wrong.' WHERE entry = 13091;
UPDATE quests SET CompletionText = 'And now we shall see what the future holds for you.$B$B<The Bone Witch casts the bones upon the rug in front of her.>$B$BChoose your fate, $c.' WHERE entry = 13092;
UPDATE quests SET CompletionText = '<You tell the darkrider about your discoveries at the summoning altar.>$B$BI suspected such. We can\'t let this continue. Our first priority is to destroy those summoning altars and then deal with the mess the Scourge has already created here.' WHERE entry = 13117;
UPDATE quests SET CompletionText = '<Darkrider Arly nods in approval.>$B$BGood. Now, we can focus our efforts on shutting down the rest of the Fleshwerks.' WHERE entry = 13119;
UPDATE quests SET CompletionText = '<Darkrider Arly closes her eyes and seems to focus on something far away.>$B$BWith the eyes of death itself, I watch our enemy. With this knowledge, we will utterly destroy them.' WHERE entry = 13120;
UPDATE quests SET CompletionText = 'Perfect! It\'s true that Iskalder is rumored to have been the finest vrykul warrior ever to live. And Vardmadra herself is going to come here to judge him!$B$BWe must move quickly if we are to get to this ancient hero before they do!' WHERE entry = 13121;
UPDATE quests SET IncompleteText = 'How\'d yeh fare in thar, matey?' WHERE entry = 13131;
UPDATE quests SET CompletionText = 'Splendid! Mebbe now me mateys be able ta rest in peace.$b$bHere ya go, $g lad:lass;. Don\'t let it be said that ol\' Brigg weren\'t generous ta those who showed \'im a kindness.$b$bGood doin\' business wit yeh.' WHERE entry = 13132;
UPDATE quests SET CompletionText = 'He\'s a fine specimen and will serve us well.$B$BNow, we have to make sure to use him properly to trap Vardmadra!' WHERE entry = 13133;
UPDATE quests SET CompletionText = '<A dark, hollow laugh greets you as you report to the darkrider.>$B$BYou reek of victory, $N, and that is good news, indeed.' WHERE entry = 13134;
UPDATE quests SET CompletionText = 'Words cannot describe what I\'m feeling at the moment, $N. My revenge is complete and there is naught else for me to do.$B$BIf only I could be there when the Lich King is finally taken down.$B$BDon\'t fool yourself though, Jotunheim is far from \'dealt\' with. I will remain in possession of this witch until such time as the vrykul are no longer a threat.$B$BLook around, there are many items of value in this cave. Take your pick.' WHERE entry = 13142;
UPDATE quests SET CompletionText = '<A fierce glow emanantes from all of Kilix\'s eyes as he stares at the husk.>$b$bIt is DONE!$b$b$R! Your name shall be recorded in the history of our people.$b$bI am in your debt....' WHERE entry = 13167;
UPDATE quests SET CompletionText = 'Always more questions than answers, eh, $g lad:lass;?\n' WHERE entry = 13207;
UPDATE quests SET CompletionText = 'You have bested our finest warriors. Your name is renowned, $N.$B$BPerhaps you think that this concerns me: it does not. If they can fall to you then they are not worthy and should be nothing but lowly vargul!$B$BBut perhaps I can give you and your friends different sport. Valhalas is also a place for combat of all types with many different kinds of foes.$B$BSpeak to me again when you and your friends are ready to proceed. We shall see if you are truly worthy.' WHERE entry = 13213;
UPDATE quests SET CompletionText = 'New blood.$B$B<The vrykul death knight spits on the ground at your feet.>$B$BYou all think that you have what it takes to fight here.$B$BYou are nothing before the might of the vrykul and the Scourge!$B$BStill, you did manage to defeat six incompetent corpses, so you must have some skill in you. Not likely enough for the next challenge though.' WHERE entry = 13214;
UPDATE quests SET CompletionText = 'You want me to be impressed by the fact that you and your friends were able to bring down a lone Nerubian priest?$B$BGet out of my sight before I summon my ghouls upon you!' WHERE entry = 13215;
UPDATE quests SET CompletionText = 'The defeat of one of the hyldnir is mildly impressive, $r, but you did have the help of your friends.$B$BYou\'re lucky that her drake didn\'t get involved.' WHERE entry = 13216;
UPDATE quests SET CompletionText = 'I\'m starting to respect your prowess in the ring, $N. Now I really don\'t like you.$B$BI would much rather have preferred to see you and your friends stuck to the bottom of that flesh giant\'s foot!' WHERE entry = 13217;
UPDATE quests SET CompletionText = 'I don\'t know what trickery it was that you used to bring down the thane -- I couldn\'t see it from this angle -- but I can assure you that you will not survive your next match.$B$BYes, I know who it is. Run, little $r. Flee to the far corners of the world.$B$BOr stay and die. It matters little to me.' WHERE entry = 13218;
UPDATE quests SET CompletionText = 'Your defeat of Prince Sandoval sickens me. An unwashed peasant such as yourself should have willingly given over $g his : her; life simply for the chance to meet him and kneel at his feet.$B$BYou\'ve earned your damned reward. Be quick about your choosing.' WHERE entry = 13219;
UPDATE quests SET RequiredTradeskillValue = '1' WHERE entry = 13303;
UPDATE quests SET CompletionText = 'Hail, $N.  Thassarian mentioned you\'d be dropping by.  Any friend of Thassarian\'s is my friend.  Well, any living friend of Thassarian, that is...  He does keep odd company.' WHERE entry = 13386;
UPDATE quests SET CompletionText = 'You\'re as good as Thassarian said.  Good job!' WHERE entry = 13387;
UPDATE quests SET IncompleteText = 'You\'re back! Were you victorious, $n?' WHERE entry = 13407;
UPDATE quests SET CompletionText = 'Excellent, excellent, thank you! I may need more of a sample to get truly conclusive results, but you\'ve done well today.' WHERE entry = 13479;
UPDATE quests SET IncompleteText = 'Do you bring word from the south?' WHERE entry = 13538;
UPDATE quests SET CompletionText = 'Very fine specimens indeed, $n! These are sure to provide many hours of curious speculation amongst my colleagues back home.' WHERE entry = 13549;
UPDATE quests SET RequiredRaces = '1100' WHERE entry = 13593;
UPDATE quests SET CompletionText = 'Stand by for verification.$b$bAccess to the Celestial Planetarium granted. Please retrieve your key.' WHERE entry = 13614;
UPDATE quests SET CompletionText = 'So you\'re saying this knight\'s story is a sham? Most suspicious. Dishonorable at the least, and murderous at the worst. Still, we can\'t confront him until we know for certain whether he was involved in these murders.$b$bDo nothing to arouse his suspicions, $N. Discretion will serve us well as we continue to investigate.' WHERE entry = 13633;
UPDATE quests SET CompletionText = 'So you\'re saying this knight\'s story is a sham? Most suspicious. Dishonorable at the least, and murderous at the worst. Still, we can\'t confront him until we know for certain whether he was involved in these murders.$b$bDo nothing to arouse his suspicions, $N. Discretion will serve us well as we continue to investigate.' WHERE entry = 13634;
UPDATE quests SET CompletionText = 'So you say Lorien Sunblaze was done in by poison and Sir Wendell was burnt alive? Dreadful ways to die, both of them. Only Conall was killed by cold steel, and from your description, it was a coward\'s strike, not honorable combat that laid him in his grave.$b$bAll three sparred with and were scheduled to fight the Black Knight. This cannot be a coincidence. Now, we must find a way to prove it was the Black Knight\'s work.' WHERE entry = 13643;
UPDATE quests SET CompletionText = '<Crusader Rhydalla examines the bag\'s contents with a look of disgust on her face.>$b$bIt\'s all here, $N: the poison that killed Lorien, a collection of knives, torches, and oil. No man has cause to possess these things here and no squire would do so without orders from his knightly master. We\'ve found our murderer, $N, but who is he working for?' WHERE entry = 13654;
UPDATE quests SET CompletionText = '<Crusader Rhydalla\'s face pales as she reads the orders.>$b$bThis can only mean one thing, $n. The Black Knight is a member of the Cult of the Damned and has been sent by Arthas to disrupt the tournament!$b$bThe Black Knight has proven himself a fearsome combatant, and you will need to be every bit as good if you wish to face him. When you are a champion, return to me and we\'ll find a way to ensure his defeat.' WHERE entry = 13663;
UPDATE quests SET CompletionText = 'With the death of the Black Knight, the tournament may once again serve its purpose. The champions of the Horde and Alliance may demonstrate their skill at arms and train for the day when Arthas and his minions will no longer threaten us.$b$bYou have the thanks of the Argent Crusade, $n, and that of all who have answered our call.' WHERE entry = 13664;
UPDATE quests SET CompletionText = 'Well done. Training against the other valiants is one of the best ways to prepare yourself for tournament competition. I know you\'ll make Stormwind proud, $n.' WHERE entry = 13665;
UPDATE quests SET CompletionText = 'So there is some truth to those old tales? It seems they did not lie about the quality of the blade. Well done, $n. The champion who wields it will be a lucky man, indeed.' WHERE entry = 13666;
UPDATE quests SET CompletionText = 'I have entered your name in the rolls, $n. As an aspirant you will train with others who wish to compete in the tournament and hone your mounted combat skills. Once you have proven yourself, you will be allowed to enter the lowest rank of competition on behalf of your capital city.' WHERE entry = 13667;
UPDATE quests SET CompletionText = 'I have entered your name in the rolls, $n. As an aspirant you will train with others who wish to compete in the tournament and hone your mounted combat skills. Once you have proven yourself, you will be allowed to enter the lowest rank of competition on behalf of your capital city.' WHERE entry = 13668;
UPDATE quests SET CompletionText = 'You have shown yourself a capable combatant, $n and you will serve as an example to the rest of the aspirants who clamor to compete on behalf of the Alliance.' WHERE entry = 13671;
UPDATE quests SET RequiredQuest1 = '13828', RequiredQuest2 = '13835', RequiredQuest3 = '13837' WHERE entry = 13672;
UPDATE quests SET CompletionText = 'So there is some truth to those old tales? It seems they did not lie about the quality of the blade. Well done, $n. The champion who wields it will be a lucky man, indeed.' WHERE entry = 13673;
UPDATE quests SET CompletionText = 'You have shown yourself a capable combatant,$n and you will serve as an example to the rest of the aspirants who clamor to compete on behalf of the Horde.' WHERE entry = 13676;
UPDATE quests SET CompletionText = 'Well done, $n. Mounted combat is often hard to pick up for those accustomed to fighting on foot. I have no doubt that you\'ll continue to improve with practice, which is more than I can say for some warriors.' WHERE entry = 13677;
UPDATE quests SET RequiredQuest1 = 13829, RequiredQuest2 = 13838, RequiredQuest3 = 13839 WHERE entry = 13678;
UPDATE quests SET CompletionText = 'Congratulations are in order, $n. You have bested your challenger and earned the right to advance to the rank of valiant.' WHERE entry = 13679;
UPDATE quests SET CompletionText = 'Congratulations are in order, $n. You have bested your challenger and earned the right to advance to the rank of valiant.' WHERE entry = 13680;
UPDATE quests SET CompletionText = 'These should do. Just don\'t go around blabbing to those crusaders about where you got them from. I\'m sure they\'ll get upset. But, hey, it\'s not like the titans have come back for them. They\'re fair game, I say. Good work, $n.' WHERE entry = 13681;
UPDATE quests SET RequiredClass = '1503', CompletionText = '$N, you and your allies have spared the tournament from a devastating attack. Though our skytalon riders are brave, they have their hands full keeping the peace on the tournament grounds and would be hard-pressed to defend the skies against the cult\'s attack. You have the thanks of the Argent Crusade and all who have gathered here to compete.' WHERE entry = 13682;
UPDATE quests SET CompletionText = 'Welcome aboard then, Valiant $n. The Stormwind delegation is proud to count you among its members.' WHERE entry = 13684;
UPDATE quests SET CompletionText = 'Welcome aboard then, Valiant $n. The Gnomeregan delegation is proud to count you among its members.' WHERE entry = 13688;
UPDATE quests SET CompletionText = 'Welcome to the Darnassus tournament delegation, $n. It will be a pleasure to train and compete alongside you.' WHERE entry = 13689;
UPDATE quests SET CompletionText = 'Welcome aboard then, Valiant $n. The Exodar\'s delegation is proud to count you among its members.' WHERE entry = 13690;
UPDATE quests SET CompletionText = 'On behalf of Thunder Bluff and its warriors, I welcome you, $n. Always fight honorably and bravely beneath our banner.' WHERE entry = 13694;
UPDATE quests SET CompletionText = 'Welcome to the Undercity delegation. $n. As a valiant, you\'ll train with us to prepare you for the highest level of competition.' WHERE entry = 13695;
UPDATE quests SET CompletionText = 'You have proven yourself worthy of the title of champion, $n. You will compete at the tournament\'s highest level on behalf of Stormwind, riding in the grand melee with your weapon at the ready and our mighty pennant at your back.' WHERE entry = 13699;
UPDATE quests SET CompletionText = 'I welcome you as a champion of the tournament, $n. As a champion, you will be able to compete for the grand championship of the tournament. You may also choose to become a valiant with another Alliance city\'s delegation and in time, a champion for that city as well.$b$bAll champions must have the assistance of a squire, $n, and you are no exception. Allow me to appoint one of ours to accompany you in battle. He will proudly carry the banner of any city that has named you a champion.' WHERE entry = 13702;
