UPDATE quests SET RequiredRaces = '1037', CompletionText = 'We\'re proud to count you among us, $n, and we look forward to training with you.' WHERE entry = 13704;
UPDATE quests SET RequiredRaces = '77', CompletionText = 'It\'s good to have you on our team, $n. We will all benefit from training with you.' WHERE entry = 13705;
UPDATE quests SET RequiredRaces = '1093' WHERE entry = 13706;
UPDATE quests SET RequiredRaces = '688', CompletionText = 'Welcome, then, $n. I look forward to watching you train with my men.' WHERE entry = 13707;
