UPDATE quests SET RequiredRaces = '658', CompletionText = 'I am honored that you have chosen to join our delegation. I know you will make us proud, $n.' WHERE entry = 13709;
UPDATE quests SET RequiredRaces = '674', CompletionText = 'You have chosen wisely, $n. Both of us will benefit from this arrangement.' WHERE entry = 13710;
