UPDATE quests SET CompletionText = 'Aww, it\'s just a stein voucher... Maybe you\'re just playing hard to get.  So here\'s this year\'s stein for you.$b$bBut I suspect I\'ll be seeing a lot more of you.  After all, if you want any Brewfest tokens redeemed, I\'m your girl...$b$bOr maybe I\'m his girl...  $b$bOooohhh... or his...', IncompleteText = 'What\'s happening hot stuff?  Got something for me?' WHERE entry = 13932;
UPDATE quests SET IncompleteText = 'We cannot allow Drottinn Hrothgar\'s men to continue their assault on our ships and our men.' WHERE entry = 14101;
