UPDATE quests SET IncompleteText = 'The Kalu\'ak have a long tradition of honing our fishing skills by putting them to the test every week.$b$bThe first person to catch and bring a blacktip shark to me will be rewarded handsomely, and be known as the greatest fisherman of the north... for a couple of days at least.$b$bThe blacktip shark\'s favorite food is the pygmy suckerfish. Try fishing for the blacktip wherever you would normally catch the suckerfish.' WHERE entry = 24803;
UPDATE quests SET CompletionText = 'You made it through in one piece? You have more gears then I thought, $n!', IncompleteText = 'Did you make it through basic training yet?  Make sure you follow Drill Sergeant\'s orders when he gives them.' WHERE entry = 25199;
UPDATE quests SET RequiredRaces = '1101', CompletionText = 'Fantastic work!$B$BThe data I received shows the radiation levels are fully within safety range of our suits. That is excellent news!', IncompleteText = 'Did you deploy all the devices?' WHERE entry = 25212;
UPDATE quests SET RequiredRaces = '1101', CompletionText = 'This is the best group of potential pilots you could find?$B$BOkay, well, I\'ll see what I can do.  I\'ve been known to turn even the biggest pile of gnarled gears into a smooth-runnin\' fightin\' machine and I expect no less with this lot.$B$BWell, I guess it\'s time to work!', IncompleteText = 'Did you find some fresh recruits?' WHERE entry = 25229;
UPDATE quests SET RequiredRaces = '1101', CompletionText = 'Oh my.  Their reactions were that different?$B$BNot completely what I was expecting, but I think I have a speech that will do.$B$BJust let me find where I put it...', IncompleteText = 'Hey, did you have a chance to test out my speeches?' WHERE entry = 25283;
UPDATE quests SET CompletionText = 'Hey, look at that!  You weren\'t blown to bits!', IncompleteText = 'Those ejection systems aren\'t going to test themselves... though that isn\'t a bad idea...', completionemote1 = '21' WHERE entry = 25285;
UPDATE quests SET RequiredRaces = '1101', CompletionText = 'Toby is all done with the speech?  Let me see...$B$B<Reads the speech> Pumping pistons! What a fantastic speech! I knew Toby was a good writer, but this is perhaps the best he\'s ever written.$B$BI think it\'s time to get you out to the battle.' WHERE entry = 25286;
UPDATE quests SET RequiredRaces = '1101', CompletionText = 'This is the final draft, then?  Let me have a look...', IncompleteText = 'Were you here to deliver Toby Zeigear\'s speech?' WHERE entry = 25287;
UPDATE quests SET CompletionText = 'Hmm... so the left leg servo was activating the right leg?  But I saw the left leg moving...$B$BEh, details.  I\'ll get to that later, but two out of three things worked: That isn\'t half bad!$B$BThanks for checking this out for me, $n.', IncompleteText = 'I\'m waiting on those test results, $n.' WHERE entry = 25289;
UPDATE quests SET CompletionText = 'Hmm... so the bullets had quite a bit of spread?$B$BTo some people that may be a problem... me, though, I see it as a blessing in disguise!$B$BOur enemies will be running all over the place, so with a bit of a spread, the tank drivers won\'t need to lead the target!', IncompleteText = 'What\'s wrong?  Did you forget how to shoot?' WHERE entry = 25295;
UPDATE quests SET RequiredRaces = '1101', CompletionText = 'Curses! We had to fall back. But Thermaplugg\'s lost, and he knows it... he\'s only bought himself time. We hold the surface, and when the radiation clears we\'ll assault and recapture Gnomeregan with a force twice this size.' WHERE entry = 25393;
UPDATE quests SET RequiredRaces = '690', CompletionText = 'These be enough for me purposes. Now comes de hard part.', IncompleteText = 'Ya helpin\' with da frogs or not?' WHERE entry = 25444;
UPDATE quests SET RequiredRaces = '690', CompletionText = '$n, you\'d be a mighty warrior and a fierce commrade to da Darkspear trolls.  De Echo Isles are OURS now and we couldn\'ta done it wit\'out ya.$b$bTake dis cloak. Wear it wit pride.  You\'d be a member of da tribe now!$b$bIn no time, da trolls will have a home again and we have you to thank for dat.' WHERE entry = 25445;
UPDATE quests SET RequiredRaces = '690', CompletionText = 'I\'m already beginnin\' to see what de frogs are seein\'. Ya done it perfectly, $n. Now Vol\'jin and I will see what Zalazane be plannin\'.' WHERE entry = 25446;
UPDATE quests SET RequiredRaces = '690', CompletionText = 'Ya found some good ones. I be trainin\' them hard and we won\'t stop until we\'ve driven Zalazane from our islands.', IncompleteText = 'We be needin\' as many volunteers as we can get.' WHERE entry = 25461;
UPDATE quests SET RequiredRaces = '690', CompletionText = 'Vanira\'s frogs be tellin\' de truth, den? Dis tiger be a druid and an ally? We couldn\'t be hopin\' for a better outcome. Dis be a good omen for de coming battle.' WHERE entry = 25470;
UPDATE quests SET RequiredRaces = '690', CompletionText = 'I will take de spirits\' advice to heart. Wit\' dem behind us and de power of de ancient loas of de Darkspear Tribe, we be ready to reclaim what\'s ours!' WHERE entry = 25480;
UPDATE quests SET RequiredRaces = '690', CompletionText = 'At last, everythin\' be ready. Now, we show Zalazane what happen to dose who defy de Darkspears!' WHERE entry = 25495;
UPDATE quests SET RequiredRaces = '1101', CompletionText = 'This is the speech from Toby?  Fantastic!$b$bRecruit, you\'ve done all we could possibly ask for and the Gnomeregan Army thanks you!$b$bWe\'ve got a strike team heading to Gnomeregan now and that wouldn\'t have been possible without your assistance.  For all of your help, we\'d like you to join the Gnomeregan Reserves!$b$bIt doesn\'t pay very well, but you do get this snazzy helmet.  Hang on to that, you might need it someday!', IncompleteText = 'What do you have there, recruit?' WHERE entry = 25500;

