UPDATE `quests` SET `CompletionText` = "That a weapon of such power has been redeemed from the clutches of evil is a great omen in these times, $n. With Quel'Delar and staunch Sunreaver allies at our side, the Lich King will have good reason to fear.$B$BThe crusade maintains an arsenal of exceptional weapons for our strongest allies. Allow me to offer you your choice from among them in return for entrusting us with the care of Quel'Delar." WHERE `entry` = '24799';

